import React, { lazy } from 'react'
import {
  PokemonContextWrapper,
  PokemonsContext
} from '../../context/Pokemons/PokemonsContext'

const HomeView = lazy(() => import('../../views/Home/Home.view'))

export const renderHomeRoute = () => (
  <PokemonContextWrapper>
    <HomeView />
  </PokemonContextWrapper>
)
